import React from "react";
import styled from "styled-components";

const LoginContainer = styled.div`
  padding-top: 70px;
  min-height: 100vh;
`;

function Login() {
  return (
    <LoginContainer>
      <h1>Login</h1>
    </LoginContainer>
  );
}

export default Login;
